"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Antibiotic-associated diarrhea (C. difficile infection) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/antibiotic-associated-diarrhea-c-difficile-infection-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H21736751\">",
"      <span class=\"h1\">",
"       What is antibiotic-associated diarrhea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Diarrhea describes bowel movements that are runny or watery, and happen 3 or more times in a day. There are different causes of diarrhea. Antibiotic-associated diarrhea can happen when people are taking or have just finished taking certain antibiotic medicines. Most often, this type of diarrhea is caused by an infection with bacteria called &ldquo;C. difficile.&rdquo; C. difficile normally lives in the intestines (",
"      <a class=\"graphic graphic_figure graphicRef66110 \" href=\"UTD.htm?28/27/29107\">",
"       figure 1",
"      </a>",
"      ). When people are on antibiotics, the C. difficile in their intestines can overgrow.",
"     </p>",
"     <p>",
"      People can get antibiotic-associated diarrhea even if they don&rsquo;t take antibiotics. They can get C. difficile infection if they touch infected people or surfaces and then don&rsquo;t wash their hands.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736758\">",
"      <span class=\"h1\">",
"       What are the symptoms of antibiotic-associated diarrhea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common symptoms are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Watery diarrhea (3 or more bowel movements for 2 or more days)",
"       </li>",
"       <li>",
"        Mild belly cramps",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People can also have more severe symptoms, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood or pus in their bowel movements",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Belly pain, nausea, or loss of appetite",
"       </li>",
"       <li>",
"        Dehydration &mdash; This is when the body loses too much water. It can cause people to have dark yellow urine and feel thirsty, tired, dizzy, or confused.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Sometimes people have C. difficile infection but don&rsquo;t have any symptoms. These people can still spread the infection to others.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736765\">",
"      <span class=\"h1\">",
"       Is there a test for antibiotic-associated diarrhea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse can test you for C. difficile infection by doing tests on a sample of your bowel movement. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736772\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to get better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. To help yourself get better, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Drink a lot of liquids that have water, salt, and sugar. Good choices are water mixed with juice, flavored soda, and soup broth. If you are drinking enough, your urine will be light yellow or almost clear.",
"       </li>",
"       <li>",
"        Try to eat a little food. Good choices are potatoes, noodles, rice, oatmeal, crackers, bananas, soup, and boiled vegetables.",
"       </li>",
"       <li>",
"        Ask your doctor if you should take &ldquo;probiotics.&rdquo; Probiotics are bacteria that are good for the intestines.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736779\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if you have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Many runny or watery bowel movements in a day",
"       </li>",
"       <li>",
"        Blood or pus in your diarrhea",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Severe belly pain or a swollen belly",
"       </li>",
"       <li>",
"        Nausea",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also see your doctor or nurse if you have any of the symptoms of dehydration listed above.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736786\">",
"      <span class=\"h1\">",
"       How is antibiotic-associated diarrhea treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are taking an antibiotic that could be causing your diarrhea, your doctor will stop it. He or she might switch you to another antibiotic.",
"     </p>",
"     <p>",
"      He or she will also treat your C. difficile infection with medicines. If your symptoms are severe, you might need to be treated in the hospital.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736793\">",
"      <span class=\"h1\">",
"       Can antibiotic-associated diarrhea be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes. To help reduce your chances of catching or spreading C. difficile infection, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wash your hands frequently with soap and water, especially after you use the bathroom and before you eat. Do not rely on alcohol-based hand rubs, because they have not been proven to prevent the spread of C. difficile.",
"       </li>",
"       <li>",
"        Follow the rules about washing hands and wearing gloves, if you visit someone in the hospital who has C. difficile infection",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736800\">",
"      <span class=\"h1\">",
"       What happens if my diarrhea comes back?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your diarrhea comes back after treatment, let your doctor or nurse know. He or she will probably use medicines to treat it again. But you might need to take the medicines for longer.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21736807\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
