var title_f27_47_28404="Pinna embryology";
var content_f27_47_28404=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F80743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F80743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 528px\">",
"   <div class=\"ttl\">",
"    Pinna embryology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 508px; height: 608px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The auricle or pinna is formed from the fusion of six raised soft tissue swellings (hillocks) on the surface of the embryo. Three of these hillocks are derived from the first branchial arch (FBA)&nbsp;and three from the second branchial arch (SBA) during the fifth and sixth weeks of intrauterine life. The hillocks of the FBA and SBA flank the first branchial cleft (FBC). The FBA and SBA contribute almost equally to the immature pinna, whereas the mature pinna predominantly originates from the SBA.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Original figure redrawn for this publication. Anson BJ, McVay CB. Surgical anatomy, 6th Edition, Philadelphia: WB Saunders, 1984. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
