var title_f27_47_28415="Variable incidence of Ewing sarcoma";
var content_f27_47_28415=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F81715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F81715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Geographic and ethnic variation in incidence of Ewing sarcoma family of tumors",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 386px; height: 547px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Striking differences in the incidence of Ewing sarcoma are well documented and are graphically evident in this illustration. The well-known near-total lack of incidence in native Africans (Zimbabwe and Nigeria with no reported incidence) as opposed to striking incidence in whites (Los Angeles, white, 3.4) fails to convey the entire story. Surveillance, Epidemiology and End Results (SEER) network data clearly document an even greater incidence in Spain and Israel (approximately 3.5) as well as in in at least two Polynesian populations, the New Zealand Maori and the Hawaiian Polynesian, with a similar incidence. At the same time, considerable variation among Asian populations is evident: China has the lowest reported incidence (0.1), Korea is intermediate (0.5), and Japan is the highest (1.0). These striking ethnic differences are not paralleled by any childhood malignancy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data adapted from: Triche TJ, Sorensen PHB. Molecular pathology of pediatric malignancies. In: Principles and Practice of Pediatric Oncology, 4th ed. Pizzo PA, Poplack DG (Eds), Lippincott Williams and Wilkins, Philadelphia 2002. p. 163.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
